void InitXmlResource()
{

    // Check for memory FS. If not present, load the handler:
    {
        wxMemoryFSHandler::AddFile(wxT("XRC_resource/dummy_file"), wxT("dummy one"));
        wxFileSystem fsys;
        wxFSFile *f = fsys.OpenFile(wxT("memory:XRC_resource/dummy_file"));
        wxMemoryFSHandler::RemoveFile(wxT("XRC_resource/dummy_file"));
        if (f) delete f;
        else wxFileSystem::AddHandler(new wxMemoryFSHandler);
    }

    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$left.png"), xml_res_file_0, xml_res_size_0);
    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$right.png"), xml_res_file_1, xml_res_size_1);
    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$x.png"), xml_res_file_2, xml_res_size_2);
    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$book_red.png"), xml_res_file_3, xml_res_size_3);
    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$book_green.png"), xml_res_file_4, xml_res_size_4);
    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$book_blue.png"), xml_res_file_5, xml_res_size_5);
    wxMemoryFSHandler::AddFile(wxT("XRC_resource/resources.cpp$._resources.xrc"), xml_res_file_6, xml_res_size_6);
    wxXmlResource::Get()->Load(wxT("memory:XRC_resource/resources.cpp$._resources.xrc"));
}
